export default  {
    palette: {
        primary: {
            light: '#b0fdfa',
            main: '#1b1b1b',
            dark: '#323534',
            contrastText: '#ffffff'
        },
        secondary: {
            light: '#323534',
            main: '#FFFFFF',
            dark: '#29bdc1',
            contrastText: '#ffffff'
        }
    },
    typography: {
        fontFamily: [
            'Futura'
        ].join(','),
        useNextVarients: true,
        button: {
            lineHeight: 0,
            fontSize: "1.2em",
            textTransform: "none"
        }
    }
}
